import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect
} from "react-router-dom";
import {ReactSession} from 'react-client-session';


function PrivateRoute({ component: Component, ...rest }) {
    const user= ReactSession.get("user")
    return (
        <Route
            {...rest}
            render={
                (props) => user !== null
                    ? <Component
                     {...props} 
                     user={user}
                    />
                    : <Redirect to={{
                        pathname: '/login',
                    }} />
            }
        />
    )
}
export default PrivateRoute
